import "./pokedex.css";

var PokedexA = require('pokedex'),
pokedex = new PokedexA();

var pokeData = "<tr>";
pokeData += "<td>" + childSnapshot.val().name + "</td>";
pokeData += "<td>" + childSnapshot.val().role + "</td>";
pokeData += "<td>" + childSnapshot.val().date + "</td>";
pokeData += "<td>" + now.diff(prevDate, 'months') +"</td>";
pokeData += "<td>" + childSnapshot.val().rate + "</td>";
pokeData += "<td></td>";
pokeData += "</tr>";

$('tbody').append(employeeData);

console.log( pokedex.pokemon() );

export default class Pokedex extends Component {

    render() {
    return (
    <div>
        <div className="container">
            <div className="row">
            <h1 className="page title">Pokedex</h1>
            </div>
        </div>
            <table className="table">
    <thead className="thead-dark">
        <tr>
        <th scope="col">#</th>
        <th scope="col">First</th>
        <th scope="col">Last</th>
        <th scope="col">Handle</th>
        </tr>
    </thead>
    <tbody>
        <tr>
        <th scope="row">1</th>
        <td>Mark</td>
        <td>Otto</td>
        <td>@mdo</td>
        </tr>
        <tr>
        <th scope="row">2</th>
        <td>Jacob</td>
        <td>Thornton</td>
        <td>@fat</td>
        </tr>
        <tr>
        <th scope="row">3</th>
        <td>Larry</td>
        <td>the Bird</td>
        <td>@twitter</td>
        </tr>
    </tbody>
    </table>
</div>    

  );
}
}
